import { DesktopMenu } from "./DesktopMenu";

export const Header = () => {
  return (
    <header>
      <div className="container">
        <div className={styles.logo}>
          <img src={logo} alt="" />
          <span>Абсолют</span>
        </div>
        <DesktopMenu />
        <MobileMenu />
      </div>
    </header>
  );
};
